    @GET
    @Produces({MediaType.TEXT_PLAIN, MediaType.APPLICATION_JSON})
    @ApiResponse(responseCode = "200", description = "Table list",
        content = @Content(
            mediaType = MediaType.APPLICATION_JSON,
            examples = @ExampleObject(
                value = "[\n    \"table_1\",\n    \"table_2\"\n]"
            )
        )
